import React from 'react';
import RegistrationForm from '../components/common/RegistrationForm';

const RegistrationPage: React.FC = () => {
  return (
    <div>
      <h1>Restaurant Owner Registration</h1>
      <RegistrationForm />
    </div>
  );
};

export default RegistrationPage;
